import React from "react"
import Image from "../../atoms/Image"

const Avatar = ({ src, alt, size }) => {
    return (
        <svg style={{ width: `100`, height: `100`}} >
            <circle style={{ cx: "10px", cy: "10px", r:"40px" }}>
                <Image src={src} alt={alt} width={size} />
            </circle>
        </svg>
    )
}

export default Avatar
